import { createAsyncThunk } from '@reduxjs/toolkit'
import { Types } from './Types'

export namespace Fetch {
	/*
        GET POSTS
    */
	export const getPostList = createAsyncThunk(
		Types.GET_POST_LIST,
		async () => {
			const response = await fetch(Types.POST_API)
			return response.json()
		}
	)
}
